import './List.css';
import ListItem from '../listItem/ListItem';


const List = ({task, selectTask}) => {


    const elem = task.map(i => <ListItem key={i.id} i={i} onClick={()=>selectTask(i.id)}/>)


    return(
        
            <ul>
                {elem}
            </ul>
        
    )
}

export default List
